import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Questions(props) {

   const question = props => {
      const quest =  props.getQuestID(props.id);
   }

    return(
        <Paper>
            <h1>Detail's page</h1> 
            <p>{quest.title}</p> 
        </Paper>
    )
}
